import mongoose from "mongoose";


const userSchema = new mongoose.Schema({
    name: {type:String, required:true},  //this means that the doctor's name is mandatory in the DB
    email: {type:String, required:true, unique:true},
    password: {type:String, required:true},
    image: {type:String,default:"data:image/png;base64,"}, 
    fees: {type:Number,required:true}, 
    address: {type:Object,default:{line1:'',line2:''}}, 
    gender: {type:String, default:"Not Selected"},
    dob: {type:String, default:"Not Selected"},
    phone: {type:String, default:"0000000000"},
}) 

const userModel = mongoose.models.user || mongoose.model('user', userSchema) //if model is available we will use it otherwise we will create it using doctorSchema

export default userModel